			<p>920812 FT  12 AUG 92 / World News in Brief: Eliminated from inquiries A man arrested in Liverpool on Sunday and questioned about the murder on Wimbledon Common of Rachel Nickell was 'eliminated from inquiries', but re-arrested in connection with other matters.</p>
